import React from "react";
import {Link} from "react-router-dom";
import './style/styie.css';
import kill from "./img/kill.jpeg"; 
import { AiFillCaretRight } from "react-icons/ai";
import { AiFillSmile } from "react-icons/ai";

const Account = styled.div`
    display: flex;
    text
`


function Sidebar(){
    return (
        <div className="left-column">

            <AiFillCaretRight/>Dashboard
            <Account>
                <img src="kill" alt="headphoto" className="headphoto"></img>

            </Account>
                <div className="Dsb">
                <ul>
                    <li><Link to="/"><AiFillSmile/>Dashboard </Link></li>
                    <li><Link to="/setting"><AiFillSmile/>Default</Link></li>
                    <li><Link to="/visualization"><AiFillSmile/>eCommerce</Link></li>
                    <li><Link to="/note"><AiFillSmile/>Projects</Link></li>
                    <li><Link to="/aboutME"><AiFillSmile/>OnlineCourses </Link></li>
                </ul>

                </div>

            </div>
            /*
        <div>

        </div>*/
    );
}

export default Sidebar;
